export const checkWin = (player, com) => {
  if (
    (player === 0 && com === 2) ||
    (player === 1 && com === 0) ||
    (player === 2 && com === 1)
  ) {
    return (res = 1), (content = "im iron man , i love you 3000");
  }
  return 0;
};
